import {Row,Col} from 'react-bootstrap'
import logo from '../assets/logo-service-chauffeurs-vtc.svg'
import {Mail,Facebook,Instagram,Twitter,MapPin,Phone } from 'lucide-react';

function Footer() {

    const currentYear = new Date().getFullYear();
    

    const handleScroll = (id) => {
      const element = document.getElementById(id);
      element.scrollIntoView({ behavior: "smooth" });
    }

    const scrollToTop = () => {
      window.scrollTo({
        top: 0,
        behavior: "smooth"
      });
    };
  

    const linkstyle = {
      cursor:"pointer"
    }

  return (
    <footer className='p-3 container pb-5'>
      <svg data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1200 120" preserveAspectRatio="none">
      < path d="M985.66,92.83C906.67,72,823.78,31,743.84,14.19c-82.26-17.34-168.06-16.33-250.45.39-57.84,11.73-114,31.07-172,41.86A600.21,600.21,0,0,1,0,27.35V120H1200V95.8C1132.19,118.92,1055.71,111.31,985.66,92.83Z" class="shape-fill"></path>
      </svg>
      <Row>
        <Col lg="4" className='p-5'>
          <img width="100%" height="100" onClick={() => scrollToTop()} src={logo} alt='logo du site' style={{cursor:"pointer"}} title='Logo du site' loading='lazy' />
          <p className='ps-4'>Une nouvelle entreprise dont l'unique objectif est de répondre aux besoins de nos clients, Nous faisons de notre mieux pour assurer un <strong>transfert</strong> parfait. n'éhsitez pas à <strong>réserver un chauffeur privé</strong> dés maintenant</p>
        </Col>
        <Col lg="4" className='d-flex justify-content-center p-5'>
          <div>
            <h6>Liens utiles</h6>
            <div style={linkstyle} className='mt-2' onClick={() => handleScroll("about")}>A propos</div>
            <div style={linkstyle} className='mt-2' onClick={() => handleScroll("services")} >Services</div>
            <div style={linkstyle} className='mt-2' onClick={() => handleScroll("tarifs")}>Tarifs</div>
            <div style={linkstyle} className='mt-2' onClick={() => handleScroll("contact")}>Contact</div>
          </div>
        </Col>
        <Col lg="4" className='d-flex justify-content-center p-5'>
          <div>
          <h6>Contact</h6>
              <div className='mt-2'><MapPin color='#5E2A40'/> Paris, France</div>
              <div className='mt-2'><Mail color='#5E2A40'/> chauffeursvtc.paris@gmail.com</div>
              <div className='mt-2'><Phone color='#5E2A40'/> +33 758 065 128</div>
              <div className='mt-3'>
                <a href='true' aria-label="Notre page facebook" className='me-3 text-dark text-decoration-none'><Facebook/></a>
                <a href='true' aria-label="Notre page instagram" className='me-3 text-dark text-decoration-none'><Instagram/></a>
                <a href='true' aria-label="Notre page twitter" className='me-3 text-dark text-decoration-none'><Twitter/></a>
              </div>
          </div>
        </Col>
      </Row>
        
      <div className='container ps-5'>
        Chauffeurs pro paris {currentYear} - tous droits réservés
      </div>

    </footer>
  );
}

export default Footer;
